import {AppBar,Toolbar,styled} from '@mui/material';

const Header=styled(AppBar)`
background: #000000`;

const Navbar=()=>{
    return (
       <Header>
        <Toolbar>
            <p>JainSS HOme</p>
            <p>User Login</p>
            <p>About use</p>
        </Toolbar>
       </Header>
    )
}

export default Navbar;
